import "./Dashboard.css";
import bell from "./assets/bell.png";
import juliana from "./assets/juliana.png";
function Dashboard() {
    return (
        <>
        <header>
            <div>
            <t3>Dashboard</t3>
            </div>
            <div>
            <img src={bell}></img>
            <img src={juliana}></img>
            <p>Juliana Silva</p>
            <p>jualiana@gamil.com</p>
            </div>
            
            
        </header>
        <body></body>
        </>
    );
}

export default Dashboard;
